	@Test
	public void aggiornaImpegno() {
		RicercaImpegnoPerChiaveOttimizzato parametroRicercaPerChiave = new RicercaImpegnoPerChiaveOttimizzato();
		
		RicercaImpegnoK impegnoDaCercare = new RicercaImpegnoK();
		BigDecimal numeroImpegno = new BigDecimal("418");
		
		impegnoDaCercare.setAnnoEsercizio(Integer.valueOf(2017));
		impegnoDaCercare.setNumeroImpegno(numeroImpegno);
		impegnoDaCercare.setAnnoImpegno(2016);
				
			
		parametroRicercaPerChiave.setRichiedente(getRichiedenteByProperties("consip", "regp"));
		parametroRicercaPerChiave.setEnte(parametroRicercaPerChiave.getRichiedente().getAccount().getEnte());
		parametroRicercaPerChiave.setpRicercaImpegnoK(impegnoDaCercare);
		
		//PER SIAC-5785 - serve caricare anche il cig dato che viene controllato nei controlli SIOPE PLUS:
		DatiOpzionaliElencoSubTuttiConSoloGliIds datiOpzionaliSubs = new DatiOpzionaliElencoSubTuttiConSoloGliIds();
		//serve caricare anche il cig dato che viene controllato nei controlli SIOPE PLUS:
		datiOpzionaliSubs.setCaricaCig(true);
		//il cup viene gratis assieme al cig (sono attr entrambi vedi funzonamento servizio)
		//quindi tanto vale farlo caricare:
		datiOpzionaliSubs.setCaricaCup(true);
		parametroRicercaPerChiave.setDatiOpzionaliElencoSubTuttiConSoloGliIds(datiOpzionaliSubs);
		RicercaImpegnoPerChiaveOttimizzatoResponse res = ricercaImpegnoPerChiaveOttimizzatoService.executeService(parametroRicercaPerChiave);
		SubImpegno sub = getTestFileObject(SubImpegno.class, "movgest/subimpegnoDaInserire.xml");
		Impegno imp = getTestFileObject(SubImpegno.class, "movgest/impegnoAggiornare.xml");
		List<SubImpegno> elencoSubImpegni = res.getImpegno().getElencoSubImpegni();
		elencoSubImpegni.add(sub);
		imp.setElencoSubImpegni(elencoSubImpegni);
		AggiornaImpegno reqAI = new AggiornaImpegno();
		reqAI.setDataOra(new Date());
		reqAI.setRichiedente(getRichiedenteByProperties("consip", "regp"));
		reqAI.setImpegno(imp);
	}

