	@Test
	public void aggiornaAccertamento() {
		//la metto qui, cosi' se si spacca non devo chiamate tutto il resto.
		ModificaMovimentoGestioneEntrata mod = getTestFileObject(ModificaMovimentoGestioneEntrata.class, "movgest/testMovgest.xml");
		
		RicercaAccertamentoPerChiaveOttimizzato requestRicerca = new RicercaAccertamentoPerChiaveOttimizzato();
		
		//istanzio la request cosÃ¬ come presente in it.csi.siac.siacfinapp.frontend.ui.action.movgest.WizardAggiornaMovGestAction.caricaDatiAccertamento(boolean)
		RicercaAccertamentoK accertamentoDaCercare = new RicercaAccertamentoK();
		BigDecimal numeroAccertamento = new BigDecimal("1");
		
		accertamentoDaCercare.setAnnoEsercizio(Integer.valueOf(2017));
		accertamentoDaCercare.setNumeroAccertamento(numeroAccertamento);
		accertamentoDaCercare.setAnnoAccertamento(2017);
		
		requestRicerca.setRichiedente(getRichiedenteByProperties("consip", "regp"));
		requestRicerca.setEnte(requestRicerca.getRichiedente().getAccount().getEnte());
		requestRicerca.setpRicercaAccertamentoK(accertamentoDaCercare);
		
		RicercaAccertamentoPerChiaveOttimizzatoResponse res = ricercaAccertamentoPerChiaveOttimizzatoService.executeService(requestRicerca);
		if(res.hasErrori()) {
			throw new BusinessException(ErroreCore.ERRORE_DI_SISTEMA.getErrore("Impossibile caricare correttamente l'accertamento."));
		}
		Accertamento acc = res.getAccertamento();
		if(acc.getUid() != 61551) {
			throw new BusinessException(ErroreCore.ERRORE_DI_SISTEMA.getErrore("Caricato accertamento sbagliato!"));
		}
		
		if(acc.getListaModificheMovimentoGestioneEntrata() == null) {
			acc.setListaModificheMovimentoGestioneEntrata(new ArrayList<ModificaMovimentoGestioneEntrata>());
		}
		
		acc.getListaModificheMovimentoGestioneEntrata().add(mod);
		
		AggiornaAccertamento reqAggiornamento = new AggiornaAccertamento();
		reqAggiornamento.setDataOra(new Date());
		reqAggiornamento.setRichiedente(getRichiedenteByProperties("consip", "regp"));
		reqAggiornamento.setAccertamento(acc);
		reqAggiornamento.setBilancio(getBilancioByProperties("consip", "regp", "2017"));
		reqAggiornamento.setSaltaInserimentoPrimaNota(false);
		reqAggiornamento.setSaltaInserimentoPrimaNotaSuSub(false);
		
		AggiornaAccertamentoResponse responseAggiornamento = aggiornaAccertamentoService.executeService(reqAggiornamento);
		assertNotNull(responseAggiornamento);
		
	}
	
