	@Test
	public void testSubAccertamento() {
		Charset charset = Charset.forName("UTF-8");
		int[] uids = new int[] {
			171848, // soggetto: 10508
			171851, //soggetto: 10526
			125131 // soggetto: 108278
		};
		Utility.BTL.initBilancio(2019);
		List<String> chunk = new ArrayList<String>(); 
		
		for (int i : uids) {
			System.out.println("elaboro: " + i);
			chunk.add("SubImpegno_uid_" + i);
			//per il test e' stato creato un metodo ad hoc che peroÃ¬ non va lasciato in impegno bil DAD e quindi e' stato ivi eliminato. lascio comunque la struttura del test per il fururo.
			SubAccertamento findSubImpegnoByUidTest = new SubAccertamento(); // impegnoBilDad.findSubAccertamentoByUidTest(uid)(i);
//			if(findSubImpegnoByUidTest == null) {
//				chunk.add("null");
//			}
			ByteArrayOutputStream baos = new ByteArrayOutputStream();
			JAXB.marshal(findSubImpegnoByUidTest, baos);
			String s = baos.toString();
			chunk.add(s);
			System.out.println("elaborato: " + i);
		}
		String united = StringUtils.join(chunk, "\n");
		System.out.println("Fallback:");
		System.out.println("*********************************");
		System.out.println(united);
		System.out.println("*********************************");
		try {
			printTestFileBytes("docs/test/movgest/SIAC-7327-subaccertamento_mapping_vecchio.xml", united.getBytes(charset));
		} catch (IOException e) {
			System.out.println("Fallback:");
			System.out.println("*********************************");
			System.out.println(united);
			System.out.println("*********************************");
			System.out.println(e.getMessage());
			e.printStackTrace();
		}
	}
	
